{
  "extends": "stylelint-config-standard",
  "rules": {
    "selector-list-comma-newline-after": "always"
  }
}

{
  "babelrcRoots": [
    ".",
    "./packages/*"
  ],
  "env": {
    "production": {
      "presets": [
        "@babel/preset-env",
        "@babel/preset-react"
      ],
      "plugins": [
        "@babel/plugin-proposal-class-properties",
        "@babel/plugin-proposal-export-default-from",
        "@babel/plugin-proposal-optional-chaining",
        "@babel/plugin-proposal-nullish-coalescing-operator"
      ]
    },
    "development": {
      "presets": [
        "@babel/preset-env",
        "@babel/preset-react"
      ],
      "plugins": [
        "@babel/plugin-proposal-class-properties",
        "@babel/plugin-proposal-export-default-from",
        "@babel/plugin-proposal-optional-chaining",
        "@babel/plugin-proposal-nullish-coalescing-operator"
      ]
    },
    "es": {
      "presets": [
        [
          "@babel/preset-env",
          {
            "modules": false
          }
        ],
        "@babel/preset-react"
      ],
      "plugins": [
        "@babel/plugin-proposal-class-properties",
        "@babel/plugin-proposal-export-default-from",
        "@babel/plugin-proposal-optional-chaining",
        "@babel/plugin-proposal-nullish-coalescing-operator"
      ]
    },
    "browser": {
      "presets": [
        "@babel/preset-env",
        "@babel/preset-react"
      ],
      "plugins": [
        "@babel/plugin-proposal-class-properties",
        "@babel/plugin-proposal-export-default-from",
        "@babel/plugin-proposal-optional-chaining",
        "@babel/plugin-proposal-nullish-coalescing-operator",
        ["@babel/plugin-transform-runtime",
          {
            "regenerator": true
          }
        ]
      ]
    }
  }
}

{
  "name": "react-vis-master",
  "version": "1.12.0",
  "license": "MIT",
  "author": "Visualization Team <visualization@uber.com>",
  "description": "Data visualization library based on React and d3.",
  "private": true,
  "workspaces": [
    "packages/showcase",
    "packages/react-vis",
    "packages/website"
  ],
  "repository": {
    "type": "git",
    "url": "https://github.com/uber-common/react-vis.git"
  },
  "bugs": {
    "url": "https://github.com/uber-common/react-vis/issues/new",
    "email": "visualization@uber.com"
  },
  "keywords": [
    "d3",
    "react",
    "visualization",
    "chart",
    "es6",
    "babel"
  ],
  "scripts": {
    "lint": "eslint .",
    "remove-unpm-rfs": "./remove-refs-to-unpm.pl"
  },
  "devDependencies": {
    "babel-eslint": "^10.1.0",
    "eslint": "6.8.0",
    "eslint-config-prettier": "^6.11.0",
    "eslint-plugin-babel": "^5.3.0",
    "eslint-plugin-prettier": "^3.1.3",
    "eslint-plugin-react": "^7.20.0",
    "eslint-plugin-react-hooks": "^4.0.4",
    "husky": "^1.1.2"
  },
  "husky": {
    "hooks": {
      "pre-commit": "npm run remove-unpm-rfs && git add yarn.lock"
    }
  },
  "volta": {
    "node": "14.18.0",
    "yarn": "1.22.4"
  },
  "resolutions": {
    "js-beautify": "1.10.3",
    "d3-color": "3.1.0"
  }
}
